import React, { Component } from 'react';

var NewComponent = React.createClass({
  render: function() {
    return (

      <a href="https://www.cookiesale.app">
        <div style={{borderRadius: '22px', overflow: 'hidden', WebkitTransform: 'translateZ(0)', boxShadow: '0 19px 51px 0 rgba(0,0,0,0.20), 0 14px 19px 0 rgba(0,0,0,0.07)'}}>
          <div style={{marginBottom: '-30px', marginLeft: '-2px'}}>
          </div></div></a>
    );
  }
});
